class Tokens {
    constructor(sdk) {
        this.tokens = new Set();
        Tokens.sdk = sdk;
        const cid = Tokens.sdk.chainId;
        const provider = Tokens.sdk.providerOrSigner;
        // ETH
        this.ETH = new sdkCore.NativeToken(cid, null, 18, "ETH", { name: "Ether", displayDecimals: 4 }, provider);
        this.tokens.add(this.ETH);
        // WETH
        this.WETH = new sdkCore.ERC20Token(cid, sdk.addresses.WETH.get(cid), 18, "WETH", {
            name: "Wrapped Ether",
            displayDecimals: 4
        }, provider);
        this.tokens.add(this.WETH);
        // BEAN
        this.BEAN = new sdkCore.ERC20Token(cid, sdk.addresses.BEAN.get(Tokens.sdk.chainId), 6, "BEAN", {
            name: "Bean",
            displayDecimals: 2
        }, provider);
        this.tokens.add(this.BEAN);
        // USDC
        this.USDC = new sdkCore.ERC20Token(cid, sdk.addresses.USDC.get(Tokens.sdk.chainId), 6, "USDC", {
            name: "USD Coin",
            displayDecimals: 2
        }, provider);
        this.tokens.add(this.USDC);
    }
    /**
     * Find a token by address
     */
    findByAddress(address) {
        for (const token of this.tokens) {
            if (token.address === address)
                return token;
        }
        return;
    }
    /**
     * Find a Token by symbol
     */
    findBySymbol(symbol) {
        for (const token of this.tokens) {
            if (token.symbol === symbol)
                return token;
        }
        return;
    }
}

